INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(1, 'BPI MICRONIZED CREATINE', 'The benefits of Micronized Creatine extend beyond just increased energy and power during workouts. Regular use of creatine has also been shown to support muscle growth and recovery, making it a popular choice among athletes and bodybuilders looking to pack on lean muscle mass. Additionally, creatine has been found to improve cognitive function, and boost mood', 50.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(2, 'Kevin Levrone Gold Creatine', 'Gold Creatine is a powder that has a high creatine content. It\'s suitable for all kinds of physical activity and is tasteless. It is a supplement that contains vitamins B6 and can help with weight loss. It also helps with fat tissue reduction and can boost endurance.\r\n', 20.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(3, 'Nutrex Creatine', 'The nutrex creatine supplies your muscles with pure creatine monohydrate leading to an increase in muscle size, enhanced athletic performance and greater \r\nhigh - intensity training capacity with noticable strength gains', 20.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(4, 'Muscletech Platinum Creatine', 'Creatine is a major storage form of fuel that drives muscular contractions when you’re lifting heavy weights. But, once you use up creatine stores, they have to be regenerated or further contractions can’t take place. It’s easy to understand, then, that if you can hyper-regenerate creatine stores in your muscles, you’ll be able to rest less between sets, get more power out of each set, get more reps from each set and, thus, stimulate more muscle fibers during each set. That leads to more lean muscle growth', 35.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(5, 'Rule 1 whey protein', 'Rule 1 made with 100% whey, providing 24g of fast-acting protein, great taste, and exceptional value, R1 Whey Blend is one of our most popular and well-rounded protein formulas.\r\n\r\n100% whey proteins\r\n3 sources: concentrates, isolates, and hydrolysates\r\n5g naturally-occurring BCAAs^^† \r\nWith all that goes into R1 Whey Blend, it\'s also important to note what doesn\'t:\r\n\r\nZERO Non-Whey Proteins\r\nZERO Spiking\r\nZERO Creamers\r\nZERO Banned Substances\r\nZERO Gluten (most flavors)', 65.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(6, 'Hydro Whey Optium Nutrition', 'Platinum Hydrowhey is the most advanced whey protein we’ve ever developed containing 100% Hydrolyzed Whey Protein Isolate. Hydrolyzed Whey Protein Isolate has much of the carbohydrates, fat and lactose ‘isolated’ out using sophisticated filtering technologies, and hydrolyzing breaks larger proteins down into smaller pieces, so ultra-pure whey isolate is able to get into your system rapidly for muscle recovery support. Finally, we dialed up this ultra-pure and rapidly digesting formula with added micronized Branched Chain Amino Acids (BCAAs).', 100.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(7, 'Optimum Nutrition Gold Standard Whey Protein', 'There are 24g of protein in every rounded scoop (29.4g). It also contains all 9 of the body\'s essential amino acids. Similarly, one scoop of Chocolate Gold Standard Whey contains just 2.75g of fat, 2.5g sugars, 5.5g carbs, and fewer than 120 calories.', 80.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(8, 'Challenger Nutrition Whey Protein', 'Challenger Nutrition 100% Whey Protein is composed of a powerful protein matrix with whey protein concentrate, whey protein isolate, and whey protein hydrolysate. Challenger whey protein shakes are designed to build lean muscle and strength, improve the cardiovascular and immune functioning, and boost energy.\r\nYou may also like', 60.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(9, 'Multivitamin Daily Rulz', 'Muscle Rulz Multivitamin Daily supplement is the daily formula your body needs to thrive. One of our specially formulated tablets per day will fuel you with all the vitamins and nutrients you need. This includes vitamins A, B6, B12, C, D, E, K, as well as important nutrients like zinc, copper, and calcium.', 20.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(10, 'Multi-V', 'Multi-V is a comprehensive multivitamin supplement designed to support overall health and well-being. With a blend of essential vitamins and minerals, this supplement can help fill nutrient gaps in your diet and support your immune system, energy levels, and more. Plus, it\'s formulated with high-quality ingredients and free from common allergens, making it a great choice for anyone looking to support their health.', 12.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(11, 'Platinum MultiVitamins Muscletech', 'A complete, advanced multivitamin complex packed with high-potency vitamins and minerals, plus an amino support matrix', 18.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(12, 'VITAL Multi Vitamins', 'Vegetarian formula\r\n\r\nIncludes potent antioxidants\r\n\r\nSupports bone, skin, cardiovascular, liver, and immune health*\r\n\r\nFree of gluten, dairy, peanut, tree nut, soy and egg. Free of artificial flavors, colors, sweeteners, excipients (fillers, coatings, binders), sugar and non-GMO', 25.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(13, 'XPN Gluta X Glutamine', 'Glutamine (Amino Acid)\r\n\r\nPrevents muscle catabolism and helps transport nitrogen from muscle tissue.\r\nMain source of energy of rapidly dividing cells (lymphocytes, enterocytes) which allows a strengthening of the immune and digestive system.\r\n\r\nMaintains volume and cell hydration optimally.\r\nStudies show that taking 2 g of L-Glutamine at bedtime increases growth hormone production by 400%.', 40.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(14, 'Glutamine Optimum Nutrition', 'Glutamine is the most abundant amino acid in the body, comprising more than 60% of the free amino acid pool in skeletal muscle and greater than 20% of total circulating amino acids. During prolonged, intense exercise, muscle glutamine levels may be depleted, and this can limit protein synthesis.¹ Glutamine Powder is an easy way to supplement your diet. This instantized powder mixes easily and is unflavored for \'stacking\' with protein shakes.', 35.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(15, 'Glutamine Redcon1', 'Glutamine restores depleted levels of this amino acid and aids protein synthesis for improved overall performance. It’s incredibly versatile and mixes easily into whey protein and other mass gainer shakes for easy and convenient supplementation throughout the day and while on the go.\r\n\r\nRECOVERY\r\nMUSCLE BUILDING\r\nSTRENGTH', 22.00, '');
INSERT INTO `products` (`id`, `name`, `description`, `price`, `image`) VALUES
(16, 'Quamtrax Glutamine', 'Glutamine is important for removing excess ammonia (a common waste product in the body). It also helps your immune system function and may be needed for normal brain function and digestion. You can usually get enough glutamine without taking a supplement because your body makes it and you get some in your diet.', 24.00, '');

